import Header from "../../components/header";
import "../../styles/styles.css";
import downloadImage from '../../assets/download.jpeg';

const Product = () => {
  const x=[
    downloadImage,downloadImage,downloadImage,downloadImage
  ]
  return (
    <div>
      <Header />
      <div className="d-flex gap-2">
        <p>hello 1</p>
        <p>{">>"}</p>
        <p>hello 2</p>
        <p>{">>"}</p>
        <p>hello 3</p>
      </div>
      <div className="text-center h1">Product</div>

      <div className="d-flex px-5">
        <div className="w-75">
          <div className="d-flex justify-content-center border ">

            <img src={downloadImage} className="w-75 h-100" alt="" />
          </div>
          <div>
            {
              x.map((item, index) => (
                <img src={item} key={index} className="w-25 h-25" alt="" />
              )
            )
            }
     

          </div>
        </div>
        <div className="w-25"></div>
      </div>
    </div>
  );
};

export default Product;
